Utils.parseSession = function (sessionId) {
  if (/^p2p-/.test(sessionId)) {
    return {
      scene: 'p2p',
      to: sessionId.replace(/^p2p-/, '')
    };
  } else if (/^team-/.test(sessionId)) {
    return {
      scene: 'team',
      to: sessionId.replace(/^team-/, '')
    };
  }
};

Utils.parseCustomMsg = function (msg) {
  if (msg.type === 'custom') {
    try {
      var cnt = JSON.parse(msg.content);
      switch (cnt.type) {
        case 1:
          return '[猜拳消息]';
        case 2:
          return '[阅后即焚]';
        case 3:
          return '[贴图表情]';
        case 4:
          return '[白板消息]';
      }
    } catch (e) {}
    return '[自定义消息]';
  }
  return '';
};
